import java.util.Random

def qatesRandomFirstName() {
    def firstNames = ["John", "Jane", "Michael", "Emily", "Chris", "Jessica", "Daniel", "Ashley", "Matthew", "Amanda"]
    return firstNames[new Random().nextInt(firstNames.size())]
}

def qatesRandomLastName() {
    def lastNames = ["Smith", "Johnson", "Williams", "Jones", "Brown", "Davis", "Miller", "Wilson", "Moore", "Taylor"]
    return lastNames[new Random().nextInt(lastNames.size())]
}

def qatesRandomEmail(String firstName, String lastName) {
    return "sdet${firstName}.${lastName}@mailinator.com".toLowerCase()
}

def qatesRandomPhoneNumber() {
    def areaCode = "991"
    def remainingDigits = String.format("%07d", new Random().nextInt(10000000))
    return "${areaCode}${remainingDigits}"
}

def qatesRandomCity() {
    def capitals = ["St. John's", "Charlottetown", "Halifax", "Fredericton", "Quebec City", "Toronto", "Winnipeg", "Regina", "Edmonton", "Victoria", 
                    "Iqaluit", "Yellowknife", "Whitehorse"]
    return capitals[new Random().nextInt(capitals.size())]
}

def qatesRandomState() {
    def provinces = ["NL", "PE", "NS", "NB", "QC", "ON", "MB", "SK", "AB", "BC", "NU", "NT", "YT"]
    return provinces[new Random().nextInt(provinces.size())]
}

def qatesRandomPostalCode() {
    def letters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    def numbers = "0123456789"
    return "${letters.charAt(new Random().nextInt(letters.length()))}${numbers.charAt(new Random().nextInt(numbers.length()))}${letters.charAt(new Random().nextInt(letters.length()))} ${numbers.charAt(new Random().nextInt(numbers.length()))}${letters.charAt(new Random().nextInt(letters.length()))}${numbers.charAt(new Random().nextInt(numbers.length()))}"
}

def qatesRandomFourDigitNumber() {
    return String.format("%04d", new Random().nextInt(10000))
}

def qatesGenerateCAProfile() {
    def firstName = qatesRandomFirstName()
    def lastName = qatesRandomLastName()
    def email = qatesRandomEmail(firstName, lastName)
    def phoneNumber = qatesRandomPhoneNumber()
    def city = qatesRandomCity()
    def state = qatesRandomState()
    def postalCode = qatesRandomPostalCode()
    def address = "123 Dealerware Ave"
    def randomNumber = qatesRandomFourDigitNumber()

    def profile = """
    CA Profile:
    Name: ${firstName} ${lastName}
    Email: ${email}
    Phone: ${phoneNumber}
    Address: ${address}
    City: ${city}
    Province: ${state}
    Postal Code: ${postalCode}
    Random 4-digit number: ${randomNumber}
    """

    return profile
}

// Generate and print the profile
def generatedProfile = qatesGenerateCAProfile()
println generatedProfile
println "Profile has been created"

// Create a new variable using the generated profile as its value
def newVariable = generatedProfile
println "New variable value:"
println newVariable
